import Head from 'next/head'

import { Table, Tag, Space } from 'antd';

const Index = (props) => {



  const columns = [
    {
      title: 'Timestamp',
      dataIndex: 'timestamp',
      render: text => <a>{text}</a>,
    },
    {
      title: 'Date',
      dataIndex: 'date',
    },
    {
      title: 'Amount',
      dataIndex: 'amount',
    },
  ];




  const data = [
    {
      timestamp: 'John Brown',
      date: 32,
      amount: 'New York No. 1 Lake Park',
    },
    {
      timestamp: 'Jim Green',
      date: 42,
      amount: 'London No. 1 Lake Park',
    },
    {
      timestamp: 'Joe Black',
      date: 32,
      amount: 'Sidney No. 1 Lake Park'
    },
  ];

  return (
    <>

      <Head>
        <title>Create Next App</title>
        <link rel="icon" href="/favicon.ico" />
        <link href="https://fonts.googleapis.com/css2?family=Poppins:wght@400;500;600;700;800&display=swap" rel="stylesheet"></link>
      </Head>

      {/* The Main Body */}
      <section className="main">

        <div className="right">

          <label>Earnings</label>

          {/* Earning Form */}
          <form action="">
            <input className="binary-input" type="date" name="date" placeholder="Enter Date" />
            <input className="binary-input" type="number" name="amount" placeholder="Enter Amount" />
            <button className="binary-button" type="submit">Insert</button>
          </form>
          {/* Earning Table */}
          <Table pagination={false} style={{ marginTop: "1rem", borderRadius: "10px" }} columns={columns} dataSource={data} />

        </div>
        <div className="left">

          <label>Expenses</label>
          {/* Earning Form */}
          <form action="">
            <input className="binary-input" type="date" name="date" placeholder="Enter Date" />
            <input className="binary-input" type="number" name="amount" placeholder="Enter Amount" />
            <button type="submit">Insert</button>
          </form>
          {/* Expense Table */}
          <Table pagination={false} style={{ marginTop: "1rem" }} columns={columns} dataSource={data} />

        </div>

      </section>

    </>
  );
}

export default Index;
